import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { Subscription } from 'rxjs';
import { User } from 'src/app/entities/User';
import { DataSharingService } from 'src/app/service/Datasharing/data-sharing.service';

@Component({
  selector: 'app-admin',
  templateUrl: './admin.component.html',
  styleUrls: ['./admin.component.css']
})
export class AdminComponent {
  activeButton: string = 'login';
  private dataSubscription!: Subscription;

  user:any =null;
  constructor(private router: Router,private dataSharingService: DataSharingService) {}
  ngOnInit(): void {
    this.router.navigate([`/admin/${this.activeButton}`]);
    this.dataSubscription=this.dataSharingService.currentData.subscribe(data => {
      this.user = data;
        this.dataSubscription.unsubscribe();
        this.router.navigate(['/admin/registration-requests']);
    }
    );

  }

  selectComponent(component: string): void {
    if (this.activeButton === component) {
      this.activeButton = '';
      this.router.navigate(['/admin']);
    } else {
      this.activeButton = component;
      this.router.navigate([`/admin/${component}`]);
    }
  }
}
<!-- admin-dashboard.component.html or similar -->
<header class="d-flex justify-content-between align-items-center">
  <div class="container">
    <div class="row g-3">
      <div class="website-logo col-md-10">
        <img src="../../../assets/logo.png" alt="Website Logo">
        <h1 class="h2 mb-0" style="font-family: MilestoneBrush; margin-top: 20px;">Kutak dobre hrane</h1>

      </div>
    </div>
    <nav class="mt-3">
      <button *ngIf="user==null" class="btn btn-outline-primary me-2" [ngClass]="{'active': activeButton === 'login'}" (click)="selectComponent('login')">Login</button>
      <button *ngIf="user!=null" class="btn btn-outline-primary me-2" [ngClass]="{'active': activeButton === 'registration-requests'}" (click)="selectComponent('registration-requests')">Registration Requests</button>
      <button *ngIf="user!=null" class="btn btn-outline-primary me-2" [ngClass]="{'active': activeButton === 'add-restaurant'}" (click)="selectComponent('add-restaurant')">Add Restaurant</button>
      <button *ngIf="user!=null" class="btn btn-outline-primary" [ngClass]="{'active': activeButton === 'add-waiter'}" (click)="selectComponent('add-waiter')">Add Waiter</button>
    </nav>
  </div>
  <h3 class="headerComponentName" >Admin component</h3>
</header>

<div class="container mt-4">

  <router-outlet></router-outlet>
</div>
